import React from 'react'
import img from '../pic/zara1.jpeg'

const item = [
  {
    id: 1,
    className: 'item',
    pic: img,
    title: '',
    text: '',
    price: '',

  }
]


const Items = () => {
  return (
  <>
    <div>
        {
          item.map(({id, pic, className, title, text, price}) => (
            <div 
              key={id}
              className={className}
            >
                <img src={pic} alt='' style={{width: '200px'}}/>
            </div>
          ))
        }
    </div>
  </>
  )
}

export default Items
